  const filteredDocuments = documents?.filter(doc => {
    const searchLower = searchTerm.toLowerCase();
    return (
      doc.sessionId.toLowerCase().includes(searchLower) ||
      (doc.customName && doc.customName.toLowerCase().includes(searchLower))
    );
  });

