                className="px-4 py-2 bg-gray-200 text-gray-700 rounded-md hover:bg-gray-300"
              >
                Cancelar
              </button>
              <button
                onClick={() => {
                  updateNameMutation.mutate({
                    sessionId: selectedDocument.sessionId,
                    customName: customName.trim(),
