                      title="Editar nome"
                    >
                      <span>✏️</span>
                    </button>
                    <button
                      onClick={() => handleDownload(doc)}
                      className="text-gray-600 hover:text-gray-900 p-1"
                      title="Download"
                    >
                      <span>⬇️</span>
                    </button>
                    <button
